import deepmerge from 'deepmerge';
import { compare } from 'fast-json-patch';

export const createSafePatch = (original: any, modified: any) => {
  return compare(original, deepmerge(original, modified));
};
export const createDestructivePatch = (original: any, modified: any) => {
  return compare(original, modified);
};
